import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope, faKey } from '@fortawesome/free-solid-svg-icons';

export default ({children, title}) => (
  <div>
    <Head>
      <title></title>
    </Head>
    <header>
      <div className='icons'>
        <div>
        <p>TechNews</p>
</div>
        <FontAwesomeIcon icon={faEnvelope} />
      </div>
    <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/hireme">
        <a>Hire Me</a>
      </Link>
      <Link href="/blog">
        <a>Blog</a>
      </Link>
    </header>
    <h1>{title}</h1>
      {children}
    <footer>footer</footer>
    <style jsx>{`
  header .icons{
    width: 100vw;
    background-color: #007cba;
  }
`}</style>

  </div>

)
